import { GlobalStyleComponent } from "styled-components";

const GlobalStyle = GlobalStyleComponent`
body{
    font-family: 'Open Sans Condensed', sans-serif;
    padding: 20px 40px;
}
a{
    color: black;
    text-decoration: none;
}
*{
    box-sizing: border-box;
}
`;
